import * as yaml from "js-yaml";
export class Lambda {
    content;
    constructor(content) {
        this.content = content;
    }
}
export const lambda = (content) => new Lambda(content);
export const lambdaYamlType = new yaml.Type("!lambda", {
    kind: "scalar",
    construct: (data) => lambda(data),
    represent: (data) => data.content,
    instanceOf: Lambda,
});
